import React, {Component} from "react";
import {BrowserRouter, Route} from 'react-router-dom';
import Home from './components/Home';

class Main extends Component {
  render(){
    return(
      <div>
        <BrowserRouter>
          <Route path="/" component={Home}></Route>
        </BrowserRouter>
      </div>
    )
  }
}

export default Main;
